import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import PaginaInicial from "./componentes/PaginaInicial";
import QuizPersonalizado from "./componentes/QuizPersonalizado";
import MapaInterativo from "./componentes/MapaInterativo";
import Carta3D from "./componentes/Carta3D";
import SurpresaFinal from "./componentes/SurpresaFinal";
import BarraNavegacao from "./componentes/BarraNavegacao";

function App() {
  return (
    <Router>
      <BarraNavegacao />
      <Switch>
        <Route path="/" exact component={PaginaInicial} />
        <Route path="/quiz" component={QuizPersonalizado} />
        <Route path="/mapa" component={MapaInterativo} />
        <Route path="/carta" component={Carta3D} />
        <Route path="/surpresa" component={SurpresaFinal} />
      </Switch>
    </Router>
  );
}

export default App;
